import React from "react";

export default function Navbar({ darkMode, toggleDarkMode }) {
  return (
    <nav className="flex justify-between items-center p-5 bg-gray-100 dark:bg-gray-900">
      <h2 className="text-2xl font-bold text-gray-900 dark:text-white">My Portfolio</h2>
      <button 
        onClick={toggleDarkMode}
        className="px-4 py-2 bg-blue-500 text-white rounded hover:bg-blue-600 dark:bg-blue-600 dark:hover:bg-blue-700 transition-colors"
      >
        {darkMode ? "‚òÄÔ∏è Light Mode" : "üåô Dark Mode"}
      </button>
    </nav>
  );
}
